import React from "react";
import Image from "../img/pic01.jpg";

const Project = ({ project }) => {
  return (
    <article style={{ backgroundImage: "url(" + { Image } + ")" }}>
      {/* <span class="image">
        <img src="../img/pic01.jpg" alt="tile-background" />
      </span> */}
      <a
        href="http://github.com/1sdc0d3r"
        target="_blank"
        rel="noopener noreferrer"
      >
        <h2>{project.title}</h2>
      </a>
      <p>{project.content}</p>
    </article>
  );
};

export default Project;
